url = 'http://kody-smajlov-vkontakte.ru/'

my_site = requests.post(url)
my_site_text = my_site.text
my_site_bs = BeautifulSoup(my_site_text)


first_table = my_site_bs.find_all('table')[1]
second_table = my_site_bs.find_all('table')[2]
smile_disc_list = []
smile_code_list = []




table_list = []
for table in my_site_bs.find_all('table')[1:20]:
    if table.find_all('tr')[0].string and len(table.find_all('tr')[0].string) > 1 :
        smile_disc_list = []
        smile_code_list = []
        for line in table.find_all('tr')[1:]:
            for td in line.find_all('td'):
                if td['class'][0] == 'description':
                    smile_disc_list.append(td.string)
            for td in line.find_all('td'):
                if td['class'][0] == 'smile_code':
                    smile_code_list.append(td.string)
        table_dict = dict(zip(smile_disc_list, smile_code_list))
        table_list.append(table_dict)
    else:
        smile_disc_list = []
        smile_code_list = []
        for line in table.find_all('tr')[2:]:
            for td in line.find_all('td'):
                if td['class'][0] == 'description':
                    smile_disc_list.append(td.string)
            for td in line.find_all('td'):
                if td['class'][0] == 'smile_code':
                    smile_code_list.append(td.string)
        table_dict = dict(zip(smile_disc_list, smile_code_list))
        table_list.append(table_dict)


[print(i, '\n') for i in table_list]

